.traffic {
  background: #f0f3ff;
  width: 100%;
  height: calc(100vh - 80px);
  padding: 1%;
  overflow: hidden;
}
.div1 {
  width: 20%;
  height: 45%;
  background: url('../../assets/images/tianqi_di.png') no-repeat;
  background-size: 100% 100%;
  border-radius: 1vh;
  margin-right: 1%;
  float: left;
  color: #ffffff;
  overflow: hidden;
  position: relative;
}
.div1_bottom {
  width: 100%;
  height: 30%;
  background: rgba(47, 49, 83, 0.18);
  margin-top: 15%;
}
.div1_bottom div {
  float: left;
  width: 33%;
  height: 100%;
}
.div1_p1 {
  height: 3vh;
  width: 100%;
  margin: 0;
  font-size: 2vh;
  line-height: 3vh;
  text-align: center;
  margin-top: 5%;
}
.div1_p2 {
  height: 3vh;
  width: 100%;
  margin: 0;
  font-size: 2vh;
  line-height: 3vh;
  text-align: center;
}
.div1_p3 {
  height: 3vh;
  width: 100%;
  margin: 0;
  font-size: 1.5vh;
  line-height: 3vh;
  text-align: center;
}
.div_header {
  width: 100%;
  height: 10%;
  font-size: 1.5vh;
  font-weight: 800;
}
.div2 {
  width: 35%;
  height: 45%;
  background: #ffffff;
  border-radius: 1vh;
  margin-right: 1%;
  float: left;
  padding: 1%;
}
.div2_zhi {
  width: 30%;
  height: 90%;
  float: left;
}
.zhi_left {
  float: left;
  width: 35%;
  height: 100%;
  text-align: right;
  line-height: 320%;
  font-size: 1.5vh;
  font-family: PingFang SC;
  font-weight: 400;
  color: rgba(165, 168, 181, 1);
  margin-right: 10%;
}
.zhi_center {
  float: left;
  width: 10%;
  height: 100%;
  text-align: right;
  background: rgba(165, 168, 181, 0.15);
  border-radius: 1vh;
  overflow: hidden;
  position: relative;
}
.zhi_center_cai {
  width: 100%;
  background: linear-gradient(
    0deg,
    rgba(137, 162, 255, 1) 0%,
    rgba(210, 193, 255, 1) 51%,
    rgba(255, 156, 196, 1) 100%
  );
  position: absolute;
  bottom: 0;
}
.zhi_right {
  float: left;
  width: 35%;
  height: 100%;
  text-align: left;
  line-height: 320%;
  font-size: 1.5vh;
  font-family: PingFang SC;
  font-weight: 400;
  color: rgba(165, 168, 181, 1);
  margin-left: 10%;
}
.div2_right {
  float: right;
  width: 60%;
  height: 90%;
  padding-right: 5%;
}
.right_list {
  width: 40%;
  height: 3vh;
  border: 1px solid rgba(63, 106, 255, 1);
  text-align: center;
  background: rgba(63, 106, 255, 0.12);
  margin-bottom: 5%;
  font-family: PingFang SC;
  font-weight: 500;
  color: rgba(63, 106, 255, 1);
  font-size: 1.5vh;
  line-height: 3vh;
  border-radius: 3vh;
}
.right_list span {
  margin-left: 10%;
  font-weight: 800;
}
.right_list1 {
  float: left;
}
.right_list2 {
  float: right;
}
.right_wenti {
  width: 100%;
  height: 50%;
  background: rgba(241, 244, 255, 0.7);
  float: left;
  margin-top: 1%;
  padding: 5%;
  font-family: PingFang SC;
  font-weight: 400;
  color: rgba(29, 33, 51, 1);
  font-size: 1.5vh;
}
.wenti_header {
  font-size: 1.5vh;
  font-family: PingFang SC;
  font-weight: 800;
  color: rgba(29, 33, 51, 1);
  padding-left: 5%;
  border-left: 5px solid #3f6aff;
  margin-bottom: 1vh;
}
.div3 {
  width: 43%;
  height: 45%;
  background: #ffffff;
  border-radius: 1vh;
  float: left;
  padding: 1%;
}
#elem {
  width: 100%;
  height: 90%;
}
.div4 {
  width: 100%;
  height: 53%;
  margin-top: 1%;
  border-radius: 1%;
  background: #ffffff;
  float: left;
  padding: 1%;
}
.div4_gun {
  width: 100%;
  overflow: auto;
  height: 80%;
  padding-top: 10px;
}
.div4_gun::-webkit-scrollbar{
  display: none;
}
.div4_header {
  font-family: PingFang SC;
  font-weight: 400;
  color: rgba(29, 33, 51, 1);
  font-size: 1vh;
}
.div4_header span{
  /* color: #3F6AFF; */
  font-size: 1.5vh;
  font-weight: 600;
}
.div4_list {
  margin-left: 1%;
  margin-right: 1%;
  width: 23%;
  height: 45%;
  background: rgba(255, 255, 255, 1);
  box-shadow: 0px 0px 5px 0px rgba(204, 204, 204, 0.5);
  overflow: hidden;
  float: left;
  margin-bottom: 1%;
}
.div4_list_header {
  width: 100%;
  height: 6vh;
  line-height: 6vh;
  font-size: 2vh;
  font-family: PingFang SC;
  font-weight: 800;
  color: rgba(29, 33, 51, 1);
  border-bottom: 1px solid #cccccc;
}
.div4_list_header img {
  height: 100%;
  float: left;
}
.div4_list_header span {
  font-size: 1.5vh;
  margin-left: 5%;
  font-family: PingFang SC;
  font-weight: 400;
  color: rgba(29, 33, 51, 1);
}
.div4_list_body {
  width: 80%;
  margin: auto;
  font-size: 1.6vh;
  height: 1.4vh;
  line-height: 2vh;
  margin-top: 5%;
}
.div4_jin {
  width: 65%;
  height: 100%;
  display: inline-block;
  background: rgba(165, 168, 181, 0.15);
  border-radius: 2vh;
  font-size: 1vh;
  margin-left: 2%;
  margin-right: 2%;
  overflow: hidden;
}
.div4_jin div {
  width: 60%;
  height: 100%;
  background: rgba(137, 162, 255, 1);
}
.div4_jin .div4_wengao{
  background:#ff9cc5;
}
.div4_jin .div4_wendi{
  background:#46d2e3;
}
.div4_jin .div4_shigao{
  background:#fcb4b2;
}
.div4_jin .div4_shidi{
  background:#A0D9De;
}
.div4_jin .div4_shi{
  background:#c5d6ff;
}
